 "<p>Enter the text for the cloze activity in to the cloze field \nby either pasting text from another source or by typing text directly into the \nfield.<\/p><p> To select words to hide, double click on the word to select it and \nclick on the Hide\/Show Word button below.<\/p><p>More than one possible answer can be defined enclosing them with pipes (|). I.e.: |dog|cat|bird|<\/p>": "<p>Digite no campo o texto para a atividade de preenchimento de espa\u00e7os, \nquer colando o texto de outra fonte quer digitando o texto diretamente no \ncampo.<\/p><p> Para selecionar as palavras a ocultar, fa\u00e7a um duplo clique na palavra para a selecionar \ne clique em Ocultar\/Mostrar no bot\u00e3o por baixo.<\/p><p>Pode-se definir mais de uma resposta poss\u00edvel mediante barras verticais (|). P.e.: |c\u00e3o|gato|p\u00e1ssaro|<\/p>", 
