 "Change the styling:": "Mudar o estilo:", 
 "<p>DropDown exercises are texts or sentences where students must select the correct words. They are often used for the following purposes:<\/p><ol><li>To check knowledge of core course concepts (this could be a pre-check, formative exercise, or summative check).<\/li><li>To check reading comprehension.<\/li><li>To check vocabulary knowledge.<\/li><li>To check word formation and\/or grammatical competence. <\/li><\/ol>": "Exerc\u00edcios drop-down s\u00e3o textos ou frases em que os estudantes devem escolher as palavras corretas num menu drop-down. S\u00e3o frequentemente usados com os seguintes objetivos:<\/p><ol><li>Verificar o conhecimento dos conceitos fundamentais do curso (quer como pr\u00e9-requisito, quer como exerc\u00edcio formativo ou como avalia\u00e7\u00e3o sumativa).<\/li><li>Verificar a compreens\u00e3o de leitura.<\/li><li>Verificar o conhecimento de vocabul\u00e1rio.<\/li><li>Verificar a compet\u00eancia gramatical e\/ou o conhecimento das regras de forma\u00e7\u00e3o de palavras.<\/li><\/ol>", 
