 "The majority of a learning resource will be \nestablishing context, delivering instructions and providing general information.\nThis provides the framework within which the learning activities are built and \ndelivered.": "A maior parte de um recurso de aprendizagem consiste em \nestabelecer o contexto, fornecer instru\u00e7\u00f5es e apresentar informa\u00e7\u00f5es gerais.\nEste iDevice fornece o contexto em que as atividades de aprendizagem s\u00e3o criadas \ne distribu\u00eddas.", 
