 "Add all the files provided for the applet\nexcept the .txt file one at a time using the add files and upload buttons. The \nfiles, once loaded will be displayed beneath the Applet code field.": "Adicionar, um por um, todos os ficheiros necess\u00e1rios para o applet,\nexceto o ficheiro .txt, usando os bot\u00f5es Adicionar e Upload. Os \nficheiros, depois de carregados, aparecer\u00e3o por baixo do campo C\u00f3digo do applet.", 
 "<p>The Wikipedia iDevice allows you to locate \nexisting content from within Wikipedia and download this content into your eXe \nresource. The Wikipedia Article iDevice takes a snapshot copy of the article \ncontent. Changes in Wikipedia will not automatically update individual snapshot \ncopies in eXe, a fresh copy of the article will need to be taken. Likewise, \nchanges made in eXe will not be updated in Wikipedia. <\/p> <p>Wikipedia content \nis covered by the GNU Free Documentation 1.2 License, and since 2009 additionally\nby the Creative Commons Attribution-ShareAlike 3.0 Unported License.<\/p>": "<p>O iDevice Wikip\u00e9dia permite localizar \nconte\u00fado existente na Wikip\u00e9dia e descarregar esse conte\u00fado para o recurso \neXe. O iDevice Wikip\u00e9dia tira \"fotografias\" do conte\u00fado do \nartigo. As mudan\u00e7as no artigo da Wikip\u00e9dia n\u00e3o alteram automaticamente a informa\u00e7\u00e3o  \ncopiada para o eXe, ser\u00e1 necess\u00e1ria uma nova c\u00f3pia do artigo. Da mesma maneira, \naltera\u00e7\u00f5es feitas no eXe n\u00e3o far\u00e3o altera\u00e7\u00f5es na Wikip\u00e9dia. <\/p> <p>O conte\u00fado da Wikip\u00e9dia \nest\u00e1 sob a licen\u00e7a GNU de documenta\u00e7\u00e3o livre 1.2, e desde 2009 adicionalmente\nsob a licen\u00e7a Creative Commons Atribui\u00e7\u00e3o-CompartilhaIgual 3.0 N\u00e3o Adaptada.<\/p>", 
