 "Enter an RSS URL for the RSS feed you \nwant to attach to your content. Feeds are often identified by a small graphic\n icon (often like this <img src=\"\/images\/feed-icon.png\" \/>) or the text \"RSS\". Clicking on the \n icon or text label will display an RSS feed right in your browser. You can copy and paste the\nURL into this field. Alternately, right clicking on the link or graphic will open a menu box;\nclick on COPY LINK LOCATION or Copy Shortcut. Back in eXe open the RSS bookmark iDevice and Paste the URL \ninto the RSS URL field and click the LOAD button. This will extract the titles from your feed and\ndisplay them as links in your content. From here you can edit the bookmarks and add\n instructions or additional learning information.": "Insira o endere\u00e7o do RSS para o qual pretende apresentar o conte\u00fado. Est\u00e3o frequentemente assinalados com um pequeno\n \u00edcone (como este <img src=\"\/images\/feed-icon.png\" \/>) ou o texto \"RSS\". Ao clicar no \n \u00edcone ou no texto o RSS apresentar-se-\u00e1 no seu navegador. Pode copiar e colar o\nendere\u00e7o neste campo. Como alternativa, clique com o bot\u00e3o do lado direito do rato no \u00edcone ou no texto e no menu do navegador;\nclique em COPIAR ATALHO ou COPIAR ENDERE\u00c7O DA LIGA\u00c7\u00c2O. Volte ao eXe abra o iDevice RSS e cole o endere\u00e7o\nno campo do RSS e clique no bot\u00e3o CARREGAR. Desta forma vai extrair a informa\u00e7\u00e3o do RSS \ne apresent\u00e1-la na sua p\u00e1gina sob a forma de liga\u00e7\u00f5es. A partir deste passo pode editar a informa\u00e7\u00e3o e adicionar\n instru\u00e7\u00f5es ou informa\u00e7\u00e3o adicional.", 
