 "yes": "sim", 
 "<dl>  <dt>If your goal is to test understanding of core concepts or reading comprehension  <\/dt>  <dd>    <p>  Write a summary of the concept or reading long  enough to adequately test the target's knowledge, but short enough not to induce fatigue. Less than one typed page is probably adequate, but probably considerably less for young students or beginners.    <\/p>    <p>Select words in the text thatare key to understanding the concepts. Thesewill probably be verbs, nouns, and key adverbs.Choose alternatives with one clear answer.    <\/p>  <\/dd>  <dt>If your goal is to test vocabulary knowledge  <\/dt>  <dd><p>Write a text using the target vocabulary. This text should be coherent and cohesive, and be of an appropriate length. Highlight the target words in the text. Choose alternatives with one clear answer.<\/p>  <\/dd>  <dt>If your goal is to test word formation\/grammar:  <\/dt>  <dd>  <p>Write a text using the target forms. This text should be coherent and cohesive, and be of an appropriate length. Remember that the goal is not vocabulary knowledge, so the core meanings of the stem words should be well known to the students.  <\/p>  <p>Highlight the target words in the text. Provide alternatives with the same word stem, but different affixes. It is a good idea to get a colleague to test the test\/exercise to make sure there are no surprises!  <\/p>  <\/dd><\/dl>": "<dl><dt>Se o objetivo for verificar a compreens\u00e3o de conceitos fundamentais ou a compreens\u00e3o de leitura:<\/dt><dd><p>Escreva um resumo do conceito ou da leitura de uma extens\u00e3o suficiente para os objetivos do teste, mas n\u00e3o t\u00e3o comprido que possa produzir cansa\u00e7o. Provavelmente menos de uma p\u00e1gina \u00e9 adequado, mas provavelmente dever\u00e1 ser bastante menos para os estudantes mais jovens ou para os principiantes.<\/p><p>Escolha no texto palavras chave para a compreens\u00e3o dos conceitos. Ser\u00e3o provavelmente verbos, substantivos e adv\u00e9rbios chave. Selecione aqueles que permitam uma resposta clara.<\/p><\/dd><dt>Se o objetivo for testar o conhecimento de vocabul\u00e1rio:<\/dt> <dd><p>Escreva um texto com um vocabul\u00e1rio alvo. O texto dever\u00e1 ser coerente e coeso, e de uma extens\u00e3o adequada. Destaque no texto as palavras que lhe interessam. Selecione aquelas que permitam uma resposta clara.<\/p><\/dd><dt>Se o objetivo for testar a gram\u00e1tica ou a forma\u00e7\u00e3o de palavras:<\/dt><dd><p>Escreva um texto onde se utilizem as formas que pretende testar. O \"texto ter\u00e1 de ser coerente e coeso, e de uma extens\u00e3o adequada. Lembre-se que o objetivo n\u00e3o \u00e9 o conhecimento do vocabul\u00e1rio, portanto o significado fundamental da raiz das palavras ter\u00e1 de ser bem conhecido pelos estudantes.<\/p><p>Saliente no texto as palavras que pretende testar. Forne\u00e7a alternativas com a mesma raiz, mas com diferentes afixos. \u00c9 boa ideia pedir a um colega que experimente o teste\/exerc\u00edcio para se certificar que n\u00e3o h\u00e1 surpresas!<\/p><\/dd><\/dl>", 
