 "Create educational resources with different contents: texts, multimedia materials, interactive activities, internet links...": "Criar recursos educativos com diferentes contextos: textos, materiais multim\u00e9dia, atividades interativas, liga\u00e7\u00f5es para conte\u00fado em Internet...", 
