 "Include Single Page export file?": "Incluir ficheiro de exporta\u00e7\u00e3o de P\u00e1gina Web \u00danica?", 
 "<p>Teachers should keep the following in mind when using this iDevice: <\/p><ol><li>Think about the number of different types of activity planned for your resource that will be visually signalled in the content. Avoid using too many different types or classification of activities otherwise learner may become confused. Usually three or four different types are more than adequate for a teaching resource.<\/li><li>From a visual design perspective, avoid having two iDevices immediately following each other without any text in between. If this is required, rather collapse two questions or events into one iDevice. <\/li><li>Think about activities where the perceived benefit of doing the activity outweighs the time and effort it will take to complete the activity. <\/li><\/ol>": "<p>O professorado deve lembrar-se do seguinte quando utilizar este iDevice: <\/p><ol><li>Pense acerca dos diferentes tipos de atividades planeadas para o seu recurso que v\u00e3o ser visualizadas. Evite usar um grande n\u00famero de atividades diferentes, pois isto pode fazer com que os estudantes fiquem confusos. Normalmente, tr\u00eas ou quatro tipos diferentes de atividades s\u00e3o mais do que suficiente para um recurso de ensino.<\/li><li> Do ponto de vista do design visual, evite ter dois iDevices seguidos sem qualquer texto entre eles. Se precisar de o fazer, prefira unir duas quest\u00f5es ou eventos num \u00fanico iDevice. <\/li><li> Pense em atividades em que o estudante sinta que o benef\u00edcio de realizar a atividade \u00e9 maior do que o tempo e o esfor\u00e7o de que precisa para realizar a atividade. <\/li><\/ol>", 
