 "<p>If left unchecked a small number of spelling and capitalization errors will be accepted. If checked only an exact match in spelling and capitalization will be accepted.<\/p><p><strong>For example:<\/strong> If the correct answer is <code>Elephant<\/code> then both <code>elephant<\/code> and <code>Eliphant<\/code> will be judged <em>\"close enough\"<\/em> by the algorithm as it only has one letter wrong, even if \"Check Capitalization\" is on.<\/p><p>If capitalization checking is off in the above example, the lowercase <code>e<\/code> will not be considered a mistake and <code>eliphant<\/code> will also be accepted.<\/p><p>If both \"Strict Marking\" and \"Check Capitalization\" are set, the only correct answer is \"Elephant\". If only \"Strict Marking\" is checked and \"Check Capitalization\" is not, \"elephant\" will also be accepted.<\/p>": "<p>Se esta op\u00e7\u00e3o estiver desmarcada, ser\u00e1 aceite um pequeno n\u00famero de erros de ortografia e mai\u00fasculas. Se a op\u00e7\u00e3o for marcada, s\u00f3 uma resposta exata em termos de ortografia e mai\u00fasculas ser\u00e1 aceite.<\/p><p><strong>Por exemplo: <\/strong> se a resposta correta for <code>Elefante<\/code>, ent\u00e3o tanto <code>elefante<\/code> como <code>Ilefante<\/code> ser\u00e3o consideradas <em>\"suficientemente corretas\"<\/em> pelo algoritmo, j\u00e1 que s\u00f3 t\u00eam uma letra errada, apesar de  \"Verificar Mai\u00fasculas \" estar ativo.<\/p><p>Se a verifica\u00e7\u00e3o das mai\u00fasculas estiver desligada no exemplo referido, a min\u00fascula <code>e<\/code> n\u00e3o ser\u00e1 considerada um erro e <code>elifante<\/code> tamb\u00e9m ser\u00e1 aceite.<\/p><p>Se tanto \"Resposta exata\" como \"Verificar Mai\u00fasculas\" estiverem selecionadas, a \u00fanica resposta correta ser\u00e1 \"Elefante\". Se s\u00f3  \"Resposta exata\" estiver ativada, e portanto \"Verificar Mai\u00fasculas \" n\u00e3o estiver ativa, \"elefante \" ser\u00e1 tamb\u00e9m aceite.<\/p>", 
