 "Although more often used in formal testing \nsituations MCQs can be used as a testing tool to stimulate thought and  \ndiscussion on topics students may feel a little reticent in responding to. \n\nWhen designing a MCQ test consider the following:\n<ul>\n<li> What learning outcomes are the questions testing<\/li>\n<li>    What intellectual skills are being tested<\/li>\n<li> What are the language skills of the audience<\/li>\n<li> Gender and cultural issues<\/li>\n<li> Avoid grammar language and question structures that might provide \n     clues<\/li>\n<\/ul>\n ": "Embora sejam usadas mais frequentemente nos exames formais, \nas atividades de escolha m\u00faltipla podem ser usadas como ferramenta para estimular a reflex\u00e3o e  \na discuss\u00e3o sobre temas em que os estudantes se possam mostrar reticentes a responder. \n\nQuando desenhar um teste de escolha m\u00faltipla considere o seguinte:\n<ul>\n<li>Que objetivos de aprendizagem est\u00e3o a ser testados com as perguntas?<\/li>\n<li>Que habilidades intelectuais est\u00e3o a ser testadas?<\/li>\n<li>Quais s\u00e3o as capacidades lingu\u00edsticas dos estudantes?<\/li>\n<li>Quest\u00f5es de g\u00e9nero e interculturais.<\/li>\n<li>Evite usar linguagem gramatical bem como formas de perguntar que possam proporcionar  \n     pistas.<\/li>\n<\/ul>\n ", 
