 "\n        <h2>Click The Elements in Order Game<\/h2>\n        <p>\n                This builds a Javascript game where the player has to click on a certain place on the main area according to the hint.  \n                When they click correctly the positive feedback will come and the game will advance.  When they click the wrong\n                area negative feedback will be shown.  When they click on the correct area an item can be revealed there.  A delay\n                can be set to make the item disappear if desired after a delay.\n        <\/p>\n\n        ": "\n        <h2>Jogo de clicar nos elementos em ordem<\/h2>\n        <p>\n                Constr\u00f3i um jogo Javascript em que o jogador tem de clicar num determinado lugar da \u00e1rea principal de acordo com uma pista.  \n                Quando clica no lugar correto, mostra-se a retroalimenta\u00e7\u00e3o positiva e o jogo avan\u00e7a.  Quando clica no lugar errado,\n                mostra-se a retroalimenta\u00e7\u00e3o negativa.  Quando clica na \u00e1rea correta, pode revelar-se nela um item.  Pode estabelecer-se\n                um tempo limite ap\u00f3s o qual este item desaparece, se se desejar.\n        <\/p>\n\n        ", 
