 "Table Properties": "Propriedades da tabela", 
 "<p>\nThe image with text iDevice can be used in a number of ways to support both\nthe emotional (affective) and learning task (cognitive) dimensions of eXe\ncontent. \n<\/p><p>\n<b>Integrating visuals with verbal summaries<\/b>\n<\/p><p>\nCognitive psychologists indicate that presenting learners with a\nrepresentative image and corresponding verbal summary (that is presented\nsimultaneously) can reduce cognitive load and enhance learning retention.\nThis iDevice can be used to present an image (photograph, diagram or\ngraphic) with a brief verbal summary covering the main points relating to\nthe image. For example, if you were teaching the functions of a four-stroke\ncombustion engine, you could have a visual for each of the four positions of\nthe piston with a brief textual summary of the key aspects of each visual.\n<\/p>": "<p>\nO iDevice Imagem com texto pode ser usado de v\u00e1rias maneiras para apoiar tanto a dimens\u00e3o \nemocional (afetiva) como a dimens\u00e3o da aprendizagem por tarefas (cognitiva) do conte\u00fado de eXe.\n<\/p><p>\n<b>Integrar imagens com descri\u00e7\u00f5es verbais <\/b>\n<\/p><p>\nOs especialistas em psicologia cognitiva indicam que apresentar aos estudantes\numa imagem representativa acompanhada de uma descri\u00e7\u00e3o verbal (quando \napresentadas simultaneamente) pode reduzir o esfor\u00e7o cognitivo e melhorar a reten\u00e7\u00e3o da aprendizagem.\nEste objeto iDevice pode ser usado para apresentar uma imagem (fotografia, diagrama ou \ngr\u00e1fico) com uma descri\u00e7\u00e3o curta das principais quest\u00f5es relacionadas com\na imagem. Por exemplo, se estiver a ensinar os ciclos a quatro tempos de um motor\nde combust\u00e3o, pode ter uma representa\u00e7\u00e3o visual para cada uma das quatro posi\u00e7\u00f5es \ndo pist\u00e3o com um breve descri\u00e7\u00e3o contextual dos pontos chave de cada momento visual.\n<\/p>", 
 "Please don't forget to write the file size.": "Por favor, n\u00e3o se esque\u00e7a de escrever o tamanho do ficheiro.", 
