 "A case study is a device that provides learners \nwith a simulation that has an educational basis. It takes a situation, generally \nbased in reality, and asks learners to demonstrate or describe what action they \nwould take to complete a task or resolve a situation. The case study allows \nlearners apply their own knowledge and experience to completing the tasks \nassigned. when designing a case study consider the following:<ul> \n<li>    What educational points are conveyed in the story<\/li>\n<li>    What preparation will the learners need to do prior to working on the \ncase study<\/li>\n<li>    Where the case study fits into the rest of the course<\/li>\n<li>    How the learners will interact with the materials and each other e.g.\nif run in a classroom situation can teams be setup to work on different aspects\nof the case and if so how are ideas feed back to the class<\/li><\/ul>": "Um estudo de caso \u00e9 um m\u00f3dulo que possibilita aos estudantes \nterem acesso a simula\u00e7\u00f5es com um objetivo educacional. \u00c9 normalmente uma situa\u00e7\u00e3o baseada \nna realidade, e \u00e9 pedido ao estudante para demonstrar ou apresentar que a\u00e7\u00e3o usaria para \ncompletar a tarefa ou resolver a situa\u00e7\u00e3o. O caso de estudo permite ao aluno  \naplicar o seu conhecimento e experi\u00eancia para completar as tarefas \natribu\u00eddas. Ao desenhar um estudo de caso considere os seguintes aspetos:<ul> \n<li> Quais os pontos educacionais a saber na hist\u00f3ria?<\/li>\n<li> Qual a prepara\u00e7\u00e3o que os alunos necessitam antes de trabalhar no \nestudo de caso?<\/li>\n<li> Onde se justifica a inclus\u00e3o do estudo de caso no curso?<\/li>\n<li> Como interagem os alunos com os materiais e uns com os outros? \nPor exemplo, no caso de funcionar em sala de aula, podem-se fazer equipas \npara trabalhar em diferentes aspetos do estudo de caso?  E no caso afirmativo, \ncomo apresentam as suas ideias ao resto da turma?<\/li><\/ul>", 
