 "SCORM Quiz": "Teste SCORM (sumativo)", 
 "Type the question stem. The question \nshould be clear and unambiguous. Avoid negative premises as these can tend to \nbe ambiguous.": "Digitar o corpo da quest\u00e3o. A quest\u00e3o \ndeve ser clara e sem ambiguidades. Evitar afirma\u00e7\u00f5es na negativa porque podem \nser amb\u00edguas.", 
 "When building an MCQ consider the following: <ul>\n<li> Use phrases that learners are familiar with and have \nencountered in their study <\/li>\n<li> Keep responses concise <\/li>\n<li> There should be some consistency between the stem and the responses <\/li>\n<li> Provide enough options to challenge learners to think about their response\n<\/li>\n<li> Try to make sure that correct responses are not more detailed than the \ndistractors <\/li>\n<li> Distractors should be incorrect but plausible <\/li>\n<\/ul>\n": "Quando criar uma atividade de escolha m\u00faltipla, considere o seguinte: <ul>\n<li> Use frases com que os alunos estejam familiarizados e que tenham encontrado \nno seu estudo.<\/li>\n<li>Fa\u00e7a breves as respostas.<\/li>\n<li>O tronco da quest\u00e3o e as respostas poss\u00edveis devem ser coerentes.<\/li>\n<li> Forne\u00e7a suficientes op\u00e7\u00f5es para fazer com que os estudantes tenham de pensar na resposta\n<\/li>\n<li> Tente que a resposta correta n\u00e3o seja mais detalhada do que \nos distratores <\/li>\n<li> Os distratores devem ser incorretos mas plaus\u00edveis <\/li>\n<\/ul>\n", 
